#
# Array, Dynamic Programming => Kind of like Kadane's algorithm. What should we keep track of
# as we iterate through the array? It should be done in O(N) time since the array has up to
# 5 * 10^4 elements.
#
from typing import List

class Solution:
    def maxScoreSightseeingPair(self, values: List[int]) -> int:
        max_val = float('-inf')
        for i, v in enumerate(values):
            if i == 0:
                max_so_far = v
            else:
                max_so_far = max(max_so_far - 1, values[i-1] - 1)
                max_val = max(max_val, max_so_far + v)
        return max_val

